  

// TypeScript Version: 4.1

/**
* Tests if a number is composite.
*
* @param x - value to test
* @returns boolean indicating whether the value is a composite number
*
* @example
* var bool = isComposite( 10.0 );
* // returns true
*
* @example
* var bool = isComposite( 11.0 );
* // returns false
*/
declare function isComposite( x: number ): boolean;


// EXPORTS //

export = isComposite;
